import React, { Fragment } from "react";
import { Button } from "@mui/material";

function ButtonBack() {
    const regresar = () => {
        window.history.back();
      };
  return (
    <Fragment>
      <Button
        onClick={regresar}
        id="regresarMenu2"
        variant="contained"
        margin="large"
        color="secondary"
      >
        Regresar
      </Button>
    </Fragment>
  );
}

export default ButtonBack;
